	(1759,169,'content_blocks_2_column_row_0_column_block_0_text','Seahorses are mainly found in shallow tropical and temperate waters throughout the world, from about 45°S to 45°N <sup id=\"cite_ref-5\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Seahorse#cite_note-5\">[5]</a></sup> and live in sheltered areas such as <a title=\"Seagrass\" href=\"https://en.wikipedia.org/wiki/Seagrass\">seagrass</a> beds, <a class=\"mw-redirect\" title=\"Estuaries\" href=\"https://en.wikipedia.org/wiki/Estuaries\">estuaries</a>, <a title=\"Coral reef\" href=\"https://en.wikipedia.org/wiki/Coral_reef\">coral reefs</a>, or <a class=\"mw-redirect\" title=\"Mangroves\" href=\"https://en.wikipedia.org/wiki/Mangroves\">mangroves</a>.'),
