	(1975,170,'content_blocks_2_column_row_0_column_block_1_text','The <b>giraffe</b> (<i>Giraffa</i>) is a <a title=\"Genus\" href=\"https://en.wikipedia.org/wiki/Genus\">genus</a> of African <a title=\"Even-toed ungulate\" href=\"https://en.wikipedia.org/wiki/Even-toed_ungulate\">even-toed ungulate</a> <a title=\"Mammal\" href=\"https://en.wikipedia.org/wiki/Mammal\">mammals</a>, the <a class=\"mw-redirect\" title=\"Largest mammals\" href=\"https://en.wikipedia.org/wiki/Largest_mammals#Even-toed_Ungulates_(Artiodactyla)\">tallest</a> living terrestrial animals and the largest <a title=\"Ruminant\" href=\"https://en.wikipedia.org/wiki/Ruminant\">ruminants</a>. The genus currently consists of one species, <i>Giraffa camelopardalis</i>, the <a title=\"Type species\" href=\"https://en.wikipedia.org/wiki/Type_species\">type species</a>.'),
