	(2304,198,'_content_blocks_3_class','field_5a2262f87053c'),
	(2305,198,'content_blocks_3_title','5 x 7 row'),
	(2306,198,'_content_blocks_3_title','field_5a210f18998a5'),
	(2307,198,'content_blocks_3_subtitle','this is a subtitle'),
	(2308,198,'_content_blocks_3_subtitle','field_5a210f25998a6'),
	(2309,198,'content_blocks_3_text','<i><b>Origami</b></i> (<span lang=\"ja\" xml:lang=\"ja\"><a class=\"extiw\" title=\"wikt:折り紙\" href=\"https://en.wiktionary.org/wiki/%E6%8A%98%E3%82%8A%E7%B4%99\">折り紙</a></span>, from <i>ori</i> meaning \"folding\", and <i>kami</i> meaning \"paper\" (<i>kami</i> changes to <i>gami</i> due to <a title=\"Rendaku\" href=\"https://en.wikipedia.org/wiki/Rendaku\">rendaku</a>)) is the <a class=\"mw-redirect\" title=\"Paper art\" href=\"https://en.wikipedia.org/wiki/Paper_art\">art</a> of paper folding, which is often associated with Japanese culture. In modern usage, the word \"origami\" is used as an inclusive term for all folding practices, regardless of their culture of origin. The goal is to transform a flat square sheet of paper into a finished sculpture through folding and sculpting techniques. Modern origami practitioners generally discourage the use of cuts, glue, or markings on the paper. Origami folders often use the Japanese word <i><span class=\"Unicode\" title=\"Japanese transliteration\"><a title=\"Kirigami\" href=\"https://en.wikipedia.org/wiki/Kirigami\">kirigami</a></span></i> to refer to designs which use cuts, although cutting is more characteristic of Chinese papercrafts.<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Origami#cite_note-1\">[1]</a></sup>'),
	(2310,198,'_content_blocks_3_text','field_5a210f2e998a7'),
	(2311,198,'content_blocks_3_cta_text','more about origami'),
	(2312,198,'_content_blocks_3_cta_text','field_5a210f44998a8'),
