	(2519,199,'content_blocks_2_column_row_0_column_block_2_subheader','ruminant mammal'),
	(2520,199,'_content_blocks_2_column_row_0_column_block_2_subheader','field_59fb72dcc1e8c'),
	(2521,199,'content_blocks_2_column_row_0_column_block_2_text','Deer appear in art from <a title=\"Paleolithic\" href=\"https://en.wikipedia.org/wiki/Paleolithic\">Paleolithic</a> <a title=\"Cave painting\" href=\"https://en.wikipedia.org/wiki/Cave_painting\">cave paintings</a> onwards, and they have played a role in mythology, religion, and literature throughout history, as well as in <a title=\"Heraldry\" href=\"https://en.wikipedia.org/wiki/Heraldry\">heraldry</a>.'),
