	(12710,335,'content_blocks_2_wysiwyg','<h2 class=\"wt100 center-text\">A new way of wellness. A new way of viewing cannabis. </h2>\r\n<h1 class=\"wt100 green-txt center-text\">Mother Earth’s Way</h1>\r\n\r\n<p class=\"center\"><img src=\"http://memedicines.local/wp-content/uploads/2018/03/people-kaleidescope.jpg\" class=\"aligncenter\" /></p>\r\n\r\n<p class=\"lg center center-text\">People of all varieties are looking to cannabis to replace other medications or recreational activities. Diversity is what makes our team strong. Our all-inclusive environment hopes to make every demographic feel welcome and at home, joining us all under a higher state of well-being and positivity using cannabis. </p>\r\n\r\n'),
